pragma solidity 0.8.3;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "./IGenCore.sol";

contract Crabada is ERC721, Ownable {
    using Strings for uint256;

    string private baseURI;

    CrabadaInfo[] public crabadaInfo;

    IGenCore public genCore;
    IERC20 public cra;
    IERC20 public tus;
    address public feeAddress;

    uint256 public craFee;
    uint256 public tusFee;

    uint256 public hatchDuration;
    uint256 public constant breedingLimit = 9;

    struct CrabadaInfo {
        uint256 daddyId;
        uint256 mommyId;
        uint256 dna;
        uint64 birthday;
        uint8 breedingCount;
    }

    event Hatch(uint256 indexed tokenId, uint256 dna);
    event Breed(uint256 indexed tokenId, uint256 daddyId, uint256 mommyId);
    event SetBreedingFee(uint256 craFee, uint256 tusFee);
    event SetHatchDuration(uint256 inSecond);

    constructor (
        string memory baseURI_,
        IERC20 cra_,
        IERC20 tus_,
        address feeAddress_,
        uint256 craFee_,
        uint256 tusFee_

    ) ERC721("Crabada", "Crabada") {
        baseURI = baseURI_;
        cra = cra_;
        tus = tus_;
        feeAddress = feeAddress_;

        craFee = craFee_;
        tusFee = tusFee_;

        // Genesis crabada
        CrabadaInfo memory g = CrabadaInfo(0,0,0xFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF,0,0);
        crabadaInfo.push(g);
        _mint(msg.sender, 0);
    }

    function mint(address account, uint256 dna) onlyOwner() external {
        uint256 tokenId = crabadaInfo.length;
        _mint(account, tokenId);
        CrabadaInfo memory ci = CrabadaInfo(0, 0, dna, uint64(block.timestamp), 0);
        crabadaInfo.push(ci);

        emit Hatch(tokenId, dna);
    }

    function _baseURI() internal view override returns (string memory){
        return baseURI;
    }

    function breed(uint256 daddyId, uint256 mommyId) external {
        require(ownerOf(daddyId) ==  msg.sender, "NOT DADDY OWNER");
        require(ownerOf(mommyId) ==  msg.sender, "NOT MOMMY OWNER");
        CrabadaInfo storage dad = crabadaInfo[daddyId];
        CrabadaInfo storage mom = crabadaInfo[mommyId];

        uint256 dadBreedingCount = dad.breedingCount;
        uint256 momBreedingCount = dad.breedingCount;
        require(dadBreedingCount <= breedingLimit && momBreedingCount <= breedingLimit, "BREEDING LIMIT");

        // Checking family
        // Not sibling
        uint256 ddId = dad.daddyId;
        uint256 dmId = dad.mommyId;
        uint256 mdId = mom.daddyId;
        uint256 mmId = mom.mommyId;
        if (ddId != 0) {
            require((ddId != mdId && ddId != mmId), "SIBLING1");
        }
        if (dmId != 0) {
            require((dmId != mmId && dmId != mdId), "SIBLING2");
        }
        // Not children
        require(ddId != mommyId && dmId != mommyId, "CHILDREN1");
        require(mdId != daddyId && mmId != daddyId, "CHILDREN2");

        // Calculate fee
    {
        uint256 craFeeDad;
        uint256 craFeeMom;
        uint256 tusFeeDad;
        uint256 tusFeeMom;
        if (ddId == 0 && dmId == 0) {
            craFeeDad = 0;
            tusFeeDad = 0;
        } else {
            craFeeDad = craFee;
            tusFeeDad = tusFee * 3 ** dadBreedingCount / 2** dadBreedingCount;
        }

        if (mdId == 0 && mmId == 0) {
            craFeeMom = 0;
            tusFeeMom = 0;
        } else {
            craFeeMom = craFee;
            tusFeeMom = tusFee * 3 ** momBreedingCount / 2** momBreedingCount;
        }

        cra.transferFrom(msg.sender, feeAddress, craFeeDad + craFeeMom);
        tus.transferFrom(msg.sender, address(tus), tusFeeDad + tusFeeMom); // burn
    }
        uint256 tokenId = crabadaInfo.length;
        _mint(msg.sender, tokenId);

        CrabadaInfo memory ci = CrabadaInfo(daddyId, mommyId, 0, uint64(block.timestamp), 0);
        crabadaInfo.push(ci);

        genCore.breed(tokenId, daddyId, mommyId);

        dad.breedingCount = uint8(dadBreedingCount) + 1;
        mom.breedingCount = uint8(momBreedingCount) + 1;

        emit Breed(tokenId, daddyId, mommyId);
    }

    function hatchOut(uint256 tokenId) external {
        require(ownerOf(tokenId) ==  msg.sender, "NOT OWNER");

        CrabadaInfo storage ci = crabadaInfo[tokenId];
        require(block.timestamp - ci.birthday >= hatchDuration, "EARLY");
        require(ci.dna == 0, "HATCHED");

        uint256 dna = genCore.hatchOut(tokenId);
        ci.dna = dna;
        emit Hatch(tokenId, dna);
    }

    function getParentsInfo(uint256 tokenId) public returns(uint256, uint256, uint256, uint256) {
        CrabadaInfo storage crab = crabadaInfo[tokenId];
        uint256 dadId= crab.daddyId;
        uint256 momId= crab.mommyId;

        CrabadaInfo storage dad = crabadaInfo[dadId];
        CrabadaInfo storage mom = crabadaInfo[momId];

        return (dadId, momId, dad.dna, mom.dna);
    }


    /////////////////////////////////////////////////////////////
    // Operator function
    /////////////////////////////////////////////////////////////
    function setGenCore(IGenCore _genCore) external onlyOwner() {
        genCore = _genCore;
    }

    function setBreedingFee(uint256 _craFee, uint256 _tusFee) external onlyOwner() {
        craFee = _craFee;
        tusFee = _tusFee;

        emit SetBreedingFee(_craFee, _tusFee);
    }

    function setHatchDuration(uint256 inSeconds) external onlyOwner() {
        hatchDuration = inSeconds;
        emit SetHatchDuration(inSeconds);
    }

    function changeBaseURI(string memory baseURI_) onlyOwner() external {
        baseURI = baseURI_;
    }

    /////////////////////////////////////////////////////////////
    // Utility functions
    /////////////////////////////////////////////////////////////
    function getCrabadaAttributes(uint256 tokenId) external returns(
        uint8 attr0,
        uint8 attr1,
        uint8 attr2,
        uint8 attr3,
        uint8 attr4,
        uint8 attr5,
        uint8 attr6,
        uint8 attr7
    ) {
        uint256 dna = crabadaInfo[tokenId].dna;
        (attr0,,) = genCore.extractGen0(dna);
        (attr1,,) = genCore.extractGen1(dna);
        (attr2,,) = genCore.extractGen2(dna);
        (attr3,,) = genCore.extractGen3(dna);
        (attr4,,) = genCore.extractGen4(dna);
        (attr5,,) = genCore.extractGen5(dna);
        (attr6,,) = genCore.extractGen6(dna);
        (attr7,,) = genCore.extractGen7(dna);

    }

    function getCrabadaProperties(uint256 tokenId) external returns(
        uint8 crabaType,
        uint8 crabaClass,
        uint8 rare0,
        uint8 rare1,
        uint8 rare2,
        uint8 rare3,
        uint8 rare4,
        uint8 rare5
    ) {
        uint256 dna = crabadaInfo[tokenId].dna;
        (crabaType,crabaClass) = genCore.extractType(dna);
        (rare0, rare1, rare2, rare3, rare4, rare5) = genCore.extractReserve(dna);
    }
}
